import {
	MDBCollapse,
	MDBContainer,
	MDBNavbar,
	MDBNavbarBrand,
	MDBNavbarItem,
	MDBNavbarLink,
	MDBNavbarNav,
} from "mdb-react";
import { FC } from "react";
import Home from "./pages/Home";

const App: FC = () => {
	return (
		<div>
			<MDBNavbar dark bgColor="dark">
				<MDBContainer>
					<MDBNavbarBrand href="#">
						<img src="/favicon.ico" height="40" alt="Mega-Hackathon" loading="lazy" />
					</MDBNavbarBrand>
					<MDBCollapse navbar show={false}>
						<MDBNavbarNav fullWidth={false} right>
							<MDBNavbarItem>
								<MDBNavbarLink active aria-current="page" href="#">
									Home
								</MDBNavbarLink>
							</MDBNavbarItem>
							<MDBNavbarItem>
								<MDBNavbarLink href="#">About</MDBNavbarLink>
							</MDBNavbarItem>
						</MDBNavbarNav>
					</MDBCollapse>
				</MDBContainer>
			</MDBNavbar>
			<Home />
		</div>
	);
};

export default App;
